import React from "react";
import ReactDOM from "react-dom";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Navbar from "../src/Components/Navbar";
import Home from "../src/Components/Home";
import Contact from "../src/Components/Contact";


const App = () => {
  return (
    <Router>
      <Navbar />
      <Routes>
        <Route path="/" Component={Home} />
        <Route path="/contact" Component={Contact} />
      </Routes>
    </Router>
  );
};

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(<App />);



<div className="contact-container">
<div className="contenido" >
  <div>
    <h1>Formulario de Contacto</h1>
  </div>
  <form className="formulario" name="formulario" onSubmit={handleSubmit}>
    <div className="contacto">
      <label htmlFor="nombre">Nombre: </label>
      <input
        type="text"
        placeholder="Jhon"
        required
        value={name}
        onChange={handleNameChange}
      />
      <label htmlFor="apellido">Apellido: </label>
      <input type="text" placeholder="Wick" required />

      <label htmlFor="tel">Telefono: </label>
      <input type="tel" required />
      <label htmlFor="mail">Mail: </label>
      <input
        type="email"
        value={email}
        onChange={handleEmailChange}
        required
      />
      {!isEmailValid && (
        <p style={{ color: "red" }}>Por favor, ingresa un correo v√°lido.</p>
      )}
    </div>
    <div className="work">
      <h2>Asunto</h2>
      <textarea
        type="text"
        maxLength="300"
        value={subject}
        onChange={handleSubjectChange}
      ></textarea>
    </div>
    <div className="descripcion">
      <h2>Mensaje: </h2>
      <textarea
        type="text"
        maxLength="300"
        value={message}
        onChange={handleMessageChange}
        placeholder="Cuentanos de que se trata..."
      ></textarea>
    </div>
    <div className="botones">
      <button type="submit" form="formulario" value="Submit">
        Enviar
      </button>
    </div>
  </form>
</div>
</div>
